import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

export function Card(props: any) {
    return (
        <View  style={[styles.card, props.style]}>
            {props.children}
        </View>
    )
}

const styles = StyleSheet.create({
    card: {
        borderRadius: 5,
        backgroundColor: '#FFFFFF',
        padding: 10,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.25,
        shadowRadius: 3.84,
        fontFamily: 'Robot'

    }
})
